import React from "react";
import { Route, Routes, Link } from 'react-router-dom';
import Post from '../post/PagePost'; 

const markdownFiles = [
  {
    name: "카테고리1", key: 0,
    posts: [
      { name: "대학공부", content: "대학 공부에 관한 내용입니다." }, 
      { name: "유니티", content: "유니티 게임 개발에 관한 내용입니다." }
    ]
  },
  {
    name: "카테고리2", key: 1,
    posts: [
      { name: "자바스크립트", content: "자바스크립트 프로그래밍에 관한 내용입니다." }, 
      { name: "리액트", content: "리액트 프레임워크에 관한 내용입니다." }
    ]
  }
];

 const Category = () => {
  return (
    <div>
    <br></br>
    <div>
      <h4>대학교 공부정리(B/1-1)</h4>
      {markdownFiles.map((category) => (
         <div> 
          <h3>{category.name}</h3>
          {category.posts.map((opt)=>(
            <Link key={0} to={`/blog/${category.name}/${opt.name}`}>
        <a>{opt.name}</a>
        </Link>
          ))}
        </div>
        ))}
       
    </div>
    <div>
    <a href="/blog">컴퓨터네트워크</a><br></br>
        <a href="/blog">리눅스마스터</a><br></br>
        <a href="/blog">C언어</a><br></br>
        <a href="/blog">html + 포토샵</a><br></br>
      
      <h4>대학교 공부정리(B/1-1)</h4>
  
        <a href="/blog/카테고리1/글1.md">디지털시스템</a><br></br>
        <a href="/blog">컴퓨터네트워크</a><br></br>
        <a href="/blog">리눅스마스터</a><br></br>
        <a href="/blog">C언어</a><br></br>
        <a href="/blog">html + 포토샵</a><br></br>
    </div>
    <div>
      <h4>대학교 공부정리(B/1-1)</h4>
  
        <a href="/blog/카테고리1/글1.md">디지털시스템</a><br></br>
        <a href="/blog">컴퓨터네트워크</a><br></br>
        <a href="/blog">리눅스마스터</a><br></br>
        <a href="/blog">C언어</a><br></br>
        <a href="/blog">html + 포토샵</a><br></br>
    </div>
    <br></br>
    <br></br>
    </div>
  );
};

export default Category;
